	["reborn_desc2"] = {code="reborn_desc2",desc="1.拥有蒂安希永久皮肤或10星及以上蒂安希的玩家激活此活动。\n2.10星及以上的蒂安希方可进行重生。\n3.重生需要消耗魂石道具，本次活动暂时限量发放。\n4.重生后返还全部本体和若干通用升星材料，并100%返还培养消耗的金币、经验、进阶石、天赋石、宝石精华。穿戴的装备、饰品、宝石也将完整卸下到背包。\n5.在界面左上方的<div fontcolor=289b14>皮肤置换</div>功能中，可进行蒂安希永久皮肤的重生。每消耗蒂安希的<div fontcolor=289b14>永久皮肤*1</div>，可兑换<div fontcolor=289b14>皮肤自选礼盒*1</div>",val=1},
